Input:
Bộ ba số đo nào dưới đây có thể là độ dài ba cạnh của một tam giác?
A. 7 cm, 3 cm, 4 cm; 
B. 7 cm, 3 cm, 5 cm;
C. 7 cm, 3 cm, 2 cm; 
D. 7 cm, 3 cm, 3 cm.

Trong các bất phương trình sau, đâu là bất phương trình bậc nhất một ẩn ?
A. 2x - y > 0; 
B. -3x - 2 ≤ 0 ; 
C. x(x + 2) < 0 ; 
D. 0x + 2 > 0 .

Pred:
Lấy `$val` là giá trị hiện tại của number $\mathcal{N}$, thêm $k$ đến nó và phân tích các trường hợp sau:

  * Nếu giá trị mới tuyệt đối bằng với `$val$`: điều kiện không có đơn vị để thực hiện万亿元 thay đổi.
  * Nếu giá trị mới lớn hơn `$val$`: điểm là giá trị lớn nhất của `$val$`.
  * Nếu giá trị mới nhỏ hơn `$val$`: điểm là giá trị nhỏ nhất của `$val$`.

Chỉ cần huấn luyện once trên giá trị của `$val$` và sử dụng các kiến thức lưu trữ từ đó để tính toán điểm.

```python
class Solution:
    def minDifference(self, nums: List[int], k: int) -> int:
        if not nums or len(nums) == 1:
            return abs(max(nums)) - abs(min(nums))

        seen = {}
        count = 0

        def change(index):
            global count
            val = nums[index]
            count += 1

            # If we have already seen this value, it means we were able to subtract k from it
            if val in seen:
                return seen[val] + count * (seen[val] == 0)

            seen[val] = count

            # If the new value is greater than the old one, make it the maximum value and update our minimum
            if val > max(nums):
                max_val = val
                min_val = min(nums)
            # Otherwise, make the new value the minimum and update our maximum
            else:
                max_val = max(nums)
                min_val = val

            return max_val - min_val

        n = len(nums)
        for index in range(n):
            change(index)

        return min_val
```

