  * Neu gia tri moi tuyet doi bang voi `$val$`: dieu kien khong co don vi de thuc hienWanYiYuan thay doi.
  * Neu gia tri moi lon hon `$val$`: diem la gia tri lon nhat cua `$val$`.
  * Neu gia tri moi nho hon `$val$`: diem la gia tri nho nhat cua `$val$`.

Chi can huan luyen once tren gia tri cua `$val$` va su dung cac kien thuc luu tru tu do de tinh toan diem.

