$\frac{MN}{AB}=\frac{MP}{AC}$, therefore $MN=2AB$, option A is correct;
$AC=2NP$, therefore option B is correct;
$MP=2BC$, therefore option C is correct;
$BC=2NP$, therefore option D is incorrect.

Therefore, the answer is (ABC).

